import React from 'react';
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button';


class Test extends React.Component {

	constructor(props) {
        super(props);

      	this.value = "helisnvodibnalo"
      	this.value1 = "vkdfjvn"


      	this.onClickHandlerBind = this.onClickHandlerBind.bind(this)
      	this.onClickHandlerBind1 = this.onClickHandlerBind1.bind(this)
    }


	onClickHandlerBind() {
		void console.log(this.value)	
	} 

	onClickHandlerBind1() {
		void console.log(this.value1)	
	} 

	render() {
	  	return (
	    	<div className="LOL" >
		    	<Button variant="contained" color="primary" onClick= {this.onClickHandlerBind}>
		      		IAMBUTTON
		    	</Button>
		    	<Button variant="contained" color="primary" onClick= {this.onClickHandlerBind1}>
		      		IAMBUTTON1
		    	</Button>
	    	</div>
	  	);
	}
}


ReactDOM.render(<Test />, document.getElementById('root'));
